import React from 'react'
import { Form, Input, Button } from 'antd'

const dummy = {
    isLoggedIn: true
}

// rafce
const Home = () => {
    return (
        <>
            <div>
                {dummy.isLoggedIn && (
                    <Form encType="multipart/form-data">
                        <Input.TextArea maxLength={140} placeholder="무슨 일이 있었나요?"></Input.TextArea>
                        <div>
                            <Input type="file" multiple hidden />
                            <Button type="primary" style={{ flow: 'right' }}>짹짹</Button>
                        </div>
                        <div>
                            {dummy.imagePaths.map((v, i) => {
                                return (
                                    <div key={v} style={{ display: 'inline-block' }}>
                                        <img src={'http://localhost:3000/' + v} style={{ width: 200 }} alt={v} />
                                        <div>
                                            <Button>제거</Button>
                                        </div>
                                    </div>
                                )
                            })}
                        </div>
                    </Form>
                )}
            </div>
        </>
    )
}

export default Home
